         Greatest Hits (Dido album)
[_________________________________________]
Greatest Hits is the third compilation album to be released by British singer-songwriter Dido
The album compiles all of Dido's singles since her first album No Angel (1999), through to her latest material,
Girl Who Got Away (2013). The two-disc collection was released on 22 November 2013 in Ireland,
and includes a new track, &quot;NYC&quot;, as well as a collection of remixes and collaborations.
The track listing was confirmed on 9 October (2013)
